import {MarkerF} from "@react-google-maps/api";


export default function TripDash(props){
    return(
        <div>
            <button onClick={props.returnHome}>Return</button>
            {props.trip.poi.map((marker)=>{
                return(
                <MarkerF position={{lat:marker.lat,lng:marker.lng}}/>
                )
            })}
        </div>
    )
}
